webpackJsonp([4948069517015],{7265:function(e,t){e.exports={data:{post:{html:"<p>It's dangerous to watch news channels with the sound turned off. I glanced at <a href=\"http://www.n24.de/\">N24</a> this afternoon, and they were scrolling headlines from Kyrgyzstan while showing pictures of Peter Harry Carstensen. My first thought was that mobs had stormed the <em>Landtag</em> in Kiel and had forced the the CDU leader into exile. </p>\n<p>Given everything that's happened in Schleswig-Holstein the past few weeks, the thought isn't really that far fetched.</p>",fields:{title:"Carstensen in Exile",date:"24 Mar 2005",url:"https://papascott.de/2005-03-24-carstensen-in-exile/"}}},pathContext:{slug:"/2005-03-24-carstensen-in-exile/",prev:{fields:{title:"Wonkette Disses Podcasters",date:"23 Mar 2005",slug:"/2005-03-23-wonkette-disses-podcasters/"}},next:{fields:{title:"Respect!",date:"24 Mar 2005",slug:"/2005-03-24-respect/"}}}}}});
